import React from 'react';
import NavBar from '../Navbar/NavBar';

export default function MyCourses (){
    return (
        <>
            <NavBar/>
            {/*div for screen from 0px to 1300px*/}
            <div className="dashcontainer">
                <div className="myProfile">
                    My Courses
                </div>
            </div>
        </>
    )
}
